import React, { useRef, useState } from "react";
// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";

import "./styles.css";

// import required modules
import { Autoplay, Pagination, Navigation } from "swiper";
import { Hidden } from "@mui/material";

export default function App() {
  return (


    <>

      <Swiper style={{
        height: "50vh",
        marginTop: "50px",
        marginBottom: "50px",
      }}
        spaceBetween={30}
        centeredSlides={true}
        autoplay={{
          delay: 2500,
          disableOnInteraction: false,
        }}
        pagination={{
          clickable: false,
        }}
        navigation={false}
        modules={[Autoplay, Pagination, Navigation]}
        className="mySwiper"
      >
        {/* make text on top slide */}
        <SwiperSlide>
          <div className="slide1">
            <div className="text">
              <h1>Best Food</h1>
              <p>Best Food in Town</p>
            </div>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="slide2">
            <div className="text">
              <h1>Best Food</h1>
              <p>Best Food in Town</p>
            </div>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="slide3">
            <div className="text">
              <h1>Best Food</h1>
              <p>Best Food in Town</p>
            </div>
          </div>
        </SwiperSlide>
      </Swiper>

      <div    style={
        {
          background: 'linear-gradient(10deg, rgba(245,255,177,1) 10%, rgba(249,152,111,1) 100%)',
          width: '100%',
          height: '100vh',
        }
      }>



      </div>
    </>
  );
}
